\" style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium;\">- Applications</a></div>\r\n	</div>\r\n</div>'),('12','Lê Sỹ Vinh','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',5,'http://uet.vnu.edu.vn/~vinhls/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Le Sy Vinh.jpg',NULL,1,'TS.',1,1,1,NULL,NULL,'<p>\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bioinformatics</p>\r\n<p>\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Natural Languages processing</p>\r\n<p>\r\n	&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Social networks</p>'),('13','Lê Quang Hiếu','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',0,'http://uet.vnu.edu.vn/~hieulq/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Le Quang Hieu.jpg','B.Sc.: Hanoi University, Vietnam, 1995\r\nMSc.: Vietnam National University, Hanoi, 1998\r\nPh.D.: Heinrich-Heine University, Duesseldorf, Germany, 2010',1,'TS.',1,1,1,'Đang cập nhật','<p>\r\n	Đang cập nhật</p>','<ul style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium;\">\r\n	<li>\r\n		Dữ liệu tr&ecirc;n Web (Data on the Web).</li>\r\n	<li>\r\n		Học m&aacute;y v&agrave; Khai mỏ dữ liệu (Machine learning &amp; Data mining).</li>\r\n</ul>'),('14','Nguyễn Cảnh Hoàng','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',0,'http://uet.vnu.edu.vn/~hoangnc/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Nguyen Canh Hoang.jpg','Đang cập nhật',1,'Ths.',1,1,2,'Đang cập nhật','<p>\r\n	Đang cập nhật</p>','<p>\r\n	Đang cập nhật</p>'),('15','Nguyễn Việt Hà','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',5,'http://uet.vnu.edu.vn/~hanv/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Nguyen Viet Ha.jpg','Tel: (04) 3754 6575',1,'PGS. TS.',1,1,2,'Đang cập nhật','<p>\r\n	Đang cập nhật</p>','<p style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium;\">\r\n	<b>C&aacute;c hướng nghi&ecirc;n cứu đang quan t&acirc;m</b></p>\r\n<ul style=\"color: rgb(0, 0, 0); font-family: \'Times New Roman\'; font-size: medium;\">\r\n	<li>\r\n		Kỹ nghệ phần mềm: kiểm chứng/kiểm thử phần mềm; kiến tr&uacute;c phần mềm; m&ocirc; h&igrave;nh ước lượng/dự to&aacute;n phần mềm.</li>\r\n	<li>\r\n		Tr&iacute; tuệ nh&acirc;n tạo: biểu diễn tri thức, suy luận, nhận dạng mẫu.</li>\r\n	<li>\r\n		E-learning: m&ocirc; h&igrave;nh ph&acirc;n lớp LMS/LCMS, adaptive learning.</li>\r\n</ul>'),('16','Nguyễn Thị Huyền Châu','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',0,'Đang cập nhật','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Teacher_default_avatar.png','Đang cập nhật',1,'TS.',2,1,2,'Đang cập nhật','<p>\r\n	Đang cập nhật</p>','<p>\r\n	Đang cập nhật</p>'),('17','Nguyễn Đình Việt','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',0,'http://uet.vnu.edu.vn/~vietnd/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Nguyen Dinh Viet.jpg','Đang cập nhật',1,'PGS. TS.',1,1,2,'Thầy giảng rất chi tiết.','<p>\r\n	Thầy rất hiểu t&acirc;m l&yacute; sinh vi&ecirc;n.</p>','<p>\r\n	Đang cập nhật</p>'),('18','Nguyễn Ngọc Hóa','<p>\r\n	Đang cập nhật</p>','Khoa CNTT',0,'http://uet.vnu.edu.vn/~hoann/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Nguyen Ngoc Hoa.jpg','Actually, I\'m a lecturer/researcher at the Department of Information Systems , University of Engineering and Technology, VNU at Hanoi. My research interests lie currently in the database systems, biometric authentication, service integrations!',1,'TS.',1,1,2,'Đang cập nhật','<p>\r\n	Đang cập nhật</p>','<p style=\"color: rgb(10, 82, 22); font-family: Verdana, sans-serif; font-size: 13px; text-align: justify;\">\r\n	This thesis concerns the dialogue negotiation modeling in spoken dialogue systems. By proposing a multisession dialogue approach, a negotiation is considered as a resolution of the dialogue system for a resource conflict between several related users. Thus, a dialogue is defined as a set of successive sessions, each one being a sub-dialogue between a single user and the system, and divided into three phases: emerging, negotiation process, and notification. Based on the dialogue strategic model and the game theory, a model of the dialogue generic management has been developed, and then extended with a multisession dialogue approach. In this model, a solution for handling misunderstanding by using a dialogic marker, called MDI, has been proposed. This model has been practically applied to the problem of organising meetings by implementing a spoken dialogue system, called Melina, in order to validate our approach. In the case of a room conflict, the user can ask Melina to contact all of relevant people to begin negotiation and obtain a compromise.</p>\r\n<p style=\"color: rgb(10, 82, 22); font-family: Verdana, sans-serif; font-size: 13px; text-align: justify;\">\r\n	Thesis director : Jean Caelen, Research director of CNRS.</p>\r\n<p style=\"color: rgb(10, 82, 22); font-family: Verdana, sans-serif; font-size: 13px; text-align: justify;\">\r\n	Theses defense:&nbsp;<strong>January 26, 2005</strong>&nbsp;at the amphith&eacute;&acirc;tre MJK - Maison Jean Kuntzmann, 110, avenue de la chimie - Domaine universitaire, St. Martin d\'H&egrave;res, France.</p>\r\n<p style=\"color: rgb(10, 82, 22); font-family: Verdana, sans-serif; font-size: 13px; text-align: justify;\">\r\n	Jury:&nbsp;<br />\r\n	Mme. Marie-France BRUANDET, president,<br />\r\n	M. Jean-Paul SANSONNET, referee,<br />\r\n	M. Jean-Yves ANTOINE, referee,<br />\r\n	M. Dominique NO&Euml;L, member,<br />\r\n	M. Jean CAELEN, director.&nbsp;</p>'),('19','Nguyễn Ngọc Bình','17/09/1959','309 E3',5,'http://uet.vnu.edu.vn/~nnbinh/','http://bluebee-uet.com/uploads/teacher/nnbinh.jpg','',1,'TS',1,1,2,NULL,'','<p class=\"p1\">\r\n	Model Verification</p>'),('2','Trần Thị Minh Châu','Đang cập nhật','Bộ môn Công nghệ Phần mềm, 309, E3',4.5,'uet.vnu.edu.vn/~chauttm/','http://bluebee-uet.com/themes/classic/assets/img/chauttm.jpg','Cô dạy khá dễ hiểu, tuy nhiên đôi khi đi