s/teacher/Teacher_default_avatar.png','',1,'TS.',1,1,2,'Đang cập nhật','<p>	Đang cập nhật</p>','<p class=\"p1\">\r\n	Model Verification</p>'),('39','Lê Nguyên Khôi','<p>	Đang cập nhật</p>','309 E3',2,'uet.vnu.edu.vn/~khoiln','http://bluebee-uet.com/uploads/teacher/Teacher_default_avatar.png','',1,'TS.',1,1,1,'Đang cập nhật','<p>	Đang cập nhật</p>','<p class=\"p1\">\r\n	Model Verification</p>'),('4','Lê Phê Đô','Đang cập nhật','Bộ môn Các Phương pháp Toán trong Công nghệ',4.8,'uet.vnu.edu.vn/~dolp/','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/dopl.png',NULL,1,'TS. ',1,1,2,NULL,NULL,NULL),('40','Nguyễn Phương Thái','<p>	Đang cập nhật</p>','Bộ môn Khoa học Máy tính',5,'http://uet.vnu.edu.vn/~thainp/','http://bluebee-uet.com/uploads/teacher/tthai.jpg','Bio: Sở thích nghiên cứu của tôi là về xử lý ngôn ngữ tự nhiên và học máy. Tôi nhận bằng Tiến sĩ về khoa học máy tính ở JAIST vào tháng 3 năm 2008. Từ tháng 6 năm 2008 tôi là giảng viên của Đại học Công nghệ.<br/>Cho sinh viên: Hiện nay tôi đang chủ trì và tham gia một số đề tài nghiên cứu về xử lý ngôn ngữ tự nhiên. Lợi ích của việc tham gia nghiên cứu khoa học là:<br/>· Được tham gia nghiên cứu các vấn đề mới, có ý nghĩa khoa học và ứng dụng<br/>· Được cấp kinh phí tham dự hội nghị, kinh phí hỗ trợ ngh',1,'TS.',1,1,1,'Đang cập nhật','<p>	Đang cập nhật</p>','<ul>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">·&nbsp;</span><span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">Học máy: các mô hình đồ thị, học bán giám sát, lập luận dựa vào văn phạm</span></li>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">· Xử lý ngôn ngữ tự nhiên: tách từ, phân tích cú pháp, gán nhãn từ loại</span></li>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">· Khai phá văn bản/web</span></li>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">· Dịch máy: dịch máy dựa vào luật, dịch máy thống kê</span></li>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">· Các lý thuyết ngôn ngữ học</span></li>\r\n	<li>\r\n		<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">· Phương pháp luận để chú giải ngôn ngữ học cho các kho ngữ liệu văn bản lớn</span></li>\r\n</ul>'),('5','Hà Tiến Ngoạn','Đang cập nhật','Viện Toán học',0,'http://math.ac.vn/vi/component/staff/?task=getProfile&staffID=41','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Ha Tien Ngoan.jpg',NULL,1,'PGS. TS. ',1,NULL,NULL,'Thầy rất dễ tính.','Nếu không quá bỏ bê thì điểm chắc chắn cao.','<ul>\r\n	<li><a href=\"http://math.ac.vn/vi/component/staff/?task=getProfile&amp;staffID=41\">H&agrave; Tiến Ngoạn</a>, Nguyen Van Ngoc, Pseudo-differential operators related to Halkel transforms and application to dual integral equations, In:&nbsp; Algebraic Structures in Partial Differential Equations Related to Complex and Clifford Analysis, Ho Chi Minh City University of Education Press (2010), 249 -- 271.</li>\r\n	<li><a href=\"http://math.ac.vn/vi/component/staff/?task=getProfile&amp;staffID=41\">H&agrave; Tiến Ngoạn</a>, N. H. Hoang, The Wronskian solutions of the Sine-Gordon equation, In:&nbsp; Algebraic Structures in Partial Differential Equations Related to Complex and Clifford Analysis, Ho Chi Minh City University of Education Press (2010) 171 -- 208.</li>\r\n	<li><a href=\"http://math.ac.vn/vi/component/staff/?task=getProfile&amp;staffID=41\">H&agrave; Tiến Ngoạn</a>,&nbsp;<a href=\"http://journals.math.ac.vn/acta/images/stories/pdf1/Vol_36_No_2/Bai14_HTNgoan_2011_5.pdf\">On characteristic systems for general multidimensional Monge-Ampere equations</a>,&nbsp;&nbsp;<a href=\"http://journals.math.ac.vn/acta/index.php/no-2-2011\">Acta Math. Vietnamica&nbsp; 36 (2011), 330 -- 344</a>.</li>\r\n</ul>'),('6','Hoàng Nam Nhật','1962','',5,'http://cpd.vn/Default.aspx?tabid=692&Doctorid=1171','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Hoang Nam Nhat.JPG',NULL,1,'TS. ',1,1,1,'Thầy khá dễ tính.','Chú ý làm bài tập thì điểm luôn luôn cao.','Đang cập nhật'),('7','Nguyễn Năng Định','15-8-1950','Phòng TN, Bộ môn (Trung tâm), Khoa Vật lý kỹ thuật & Công nghệ nano',0,'http://www.vnu.edu.vn/upload/2010/08/210/file/Nguyen%20Nang%20Dinh.pdf','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Nguyen Nang Dinh.JPG',NULL,1,'GS. ',1,3,1,'Thầy rất thoải mái.','Làm đủ bài tập điểm sẽ rất cao.','<ul>\r\n	<li>T&aacute;c giả cuốn Vật l&yacute; v&agrave; C&ocirc;ng nghệ m&agrave;ng mỏng, NXB ĐHQGHN - 2005</li>\r\n	<li>Chủ bi&ecirc;n cuốn Thực h&agrave;nh C&ocirc;ng nghệ, NXB ĐHQGHN - 2007</li>\r\n	<li>[1]V.T.Bich, N.N.Dinh, N.H.Hoang, T.X.Hoai, L.V.Hong and V.D.Mien, Preparation of In2O3: Sn (ITO) Thin&nbsp;</li>\r\n	<li>Films by Electron Beam Deposition, Phys.Stat.Sol.(a), 102, K.91-95 (1987).&nbsp;</li>\r\n	<li>[2]. O. Erlandsson, J.Lindvall, N.N.Toan, N.V.Hung, V.T.Bich and N.N.Dinh, Electrochromic Properties of&nbsp;</li>\r\n	<li>Manganese Oxide (MnOx) Thin Films made by Electron Beam Deposition, Phys.Stat.Sol.(a), 139, pp. 451-457&nbsp;</li>\r\n	<li>(1993).&nbsp;</li>\r\n	<li>[3]. M.C.Bernard, A.Hugot-Le Goff, S.Joiret, N.N.Dinh, N.N.Toan, Polyaniline Layer for Iron Protection in Sulfate&nbsp;</li>\r\n	<li>Medium, J.Electrochem.Society, 146, (3) pp. 995-998 (1999).&nbsp;</li>\r\n	<li>[4]. N. N. Dinh, N. Th. T. Oanh, P. D. Long, M. C. Bernard, A. Hugot-Le Goff, Electrochromic properties of TiO2</li>\r\n	<li>anatase thin films prepared by dipping sol-gel method, Thin Solid Films 423, No.1, pp. 70-76 (2003)&nbsp;</li>\r\n	<li>[5]. Nguyen Nang Dinh, Marie-Claude Bernard, Anne Hugot-Le Goff, Thomas Stergiopoulos, Polycarpos Falaras,&nbsp;Photoelectrochemical solar cells based on SnO2 nanocrystalline films, C.R.Chimie 9 (2006) pp. 676-683.</li>\r\n</ul>\r\n'),('8','Ho&agrave;ng Xu&acirc;n T&ugrave;ng','','<p>\r\n	Khoa C&ocirc;ng nghệ th&ocirc;ng tin</p>',NULL,'','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Teacher_default_avatar.png',NULL,1,'TS',1,1,2,NULL,'<p>\r\n	Đừng nghe những g&igrave; thầy n&oacute;i ^^</p>',NULL),('9','Nguyễn Tr&iacute; Th&agrave;nh','','<p>\r\n	305, E3</p>',5,'<p>\r\n	http://fit.uet.vnu.edu.vn/users/40</p>','http://bluebee-uet.com/themes/classic/assets/img/Teacher_img/Teacher_default_avatar.png',NULL,1,'TS',1,1,2,'<p>\r\n	B&igrave;nh tĩnh, điềm đạm</p>','<p>\r\n	Chăm chỉ học theo c&aacute;ch của thầy</p>','<p>\r\n	<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">+ Khai ph&aacute; dữ liệu (ph&acirc;n lớp, ph&acirc;n cụm)</span><br style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\" />\r\n	<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">+ Tr&iacute;ch chọn thực thể</span><br style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\" />\r\n	<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\">+ T&iacute;ch hợp hệ thống (tr&ecirc;n Linux)</span><br style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 19.5120010375977px;\" />\r\n	<span style=\"color: rgb(56, 56, 56); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 1